import React from 'react';

import { Link } from 'react-router-dom';

const User = ({ infoUser })  => {
  const {avatar, name, username, } = infoUser;

  return (
    <article className="post" data-testid="user">
      <header className="post__header">
        <Link to="/users/black-panther">
          <div className="user__thumb">
            <img src="https://viniciusvinna.netlify.app/assets//api-instagram/profiles/black-panther/black-panther-profile.jpg" alt=""/>
          </div>
          <div className="user__name">
            {name}
          </div>
        </Link>
      </header>
    </article>
  )
};

export default User;
